const shuffle = array => {
  for (let i = array.length - 1; i > 0; i--) {
    const j = Math.floor(Math.random() * (i + 1));
    [array[i], array[j]] = [array[j], array[i]]; // Swap elements
  }
  return array;
};
paths = shuffle(paths);

const generateList = () => {
  paths = shuffle(paths);
  for (let l = 0; l < lists.length; l++) {
    const list = lists[l];
    list.style.setProperty('--index', l);
    list.style.setProperty('--items', config.items);
    list.innerHTML = `
      ${new Array(config.items).
    fill().
    map((_, index) => {
      const pathIndex = l * config.items + index;
      const { title, path } = paths[pathIndex] || paths[0];
      return `
            <li data-logo style="--i: ${index + 1};">
              <svg
                role="img"
                viewBox="0 0 24 24"
                xmlns="http://www.w3.org/2000/svg"
              >
                <title>${title}</title>
                <defs>
                  <path id="path-${pathIndex}" d="${path}" />
                </defs>
                <use fill="red" style="--u: 0;" xlink:href="#path-${pathIndex}" />
                <use fill="yellow" style="--u: 1;" xlink:href="#path-${pathIndex}" />
                <use fill="#1061ff" style="--u: 2;" xlink:href="#path-${pathIndex}" />
                <use fill="currentColor" style="--u: 3;" xlink:href="#path-${pathIndex}" />
              </svg>
            </li>
            ${l === 0 ? `<li data-marker style="--i: ${index + 1};"></li>` : ''}
          `;
    }).
    join('')}
    `;
  }
};

const generateKeyframes = () => {
  // to work out the keyframes, you need to use the number of items and work out the frames
  // it's tricky but you want to give it pre padding and transition percentage too
  // for example, if you have 5 items, you need a 20% window with the underlap
  // for 3 items, you need 100% - 33.3333% with the underlap
  //
  // for 5 items: [0, 78], [80, 98], [100] so it's 20% with a 2% underlap going on here
  // for 3 items then:
  const base = Number.parseFloat((100 - 100 / config.items).toFixed(2));
  const first = base - config.underlap;
  const mid = base + config.transition;
  const end = 100 - config.underlap - config.transition;
  const keyframes = `
    @keyframes appear {
      0%, ${first}% {
        animation-timing-function: ease-out;
        filter: blur(calc(var(--blur, 0) * 1px));
        opacity: var(--opacity, 0);
        translate:
          calc((var(--movement-x, 0) + (var(--u, 0) * var(--movement-step, 0))) * -1px)
          calc((var(--movement-y, 0) + (var(--u, 0) * var(--movement-step, 0))) * 1px);
      }
      ${mid}%, ${end}% {
        animation-timing-function: ease-in;
        filter: blur(0px);
        opacity: 1;
        translate: 0 0;
        z-index: 2;
      }
      100% {
        filter: blur(calc(var(--blur, 0) * 1px));
        opacity: var(--opacity, 0);
        translate:
          calc((var(--movement-x, 0) + (var(--u, 0) * var(--movement-step, 0))) * 1px)
          calc((var(--movement-y, 0) + (var(--u, 0) * var(--movement-step, 0))) * -1px);
      }
    }
  `;
  console.info({ keyframes });
  sheet.innerHTML = keyframes;
};

const ctrl = new Pane({
  title: 'Config',
  expanded: true });


const update = event => {
  document.documentElement.dataset.theme = config.theme;
  document.documentElement.dataset.explode = config.explode;
  document.documentElement.style.setProperty('--duration', config.duration);
  document.documentElement.style.setProperty('--stagger', config.stagger);
  document.documentElement.style.setProperty('--movement-x', config.x);
  document.documentElement.style.setProperty('--movement-y', config.y);
  document.documentElement.style.setProperty('--movement-step', config.step);
  document.documentElement.style.setProperty('--blur', config.blur);
  if (
  (event === null || event === void 0 ? void 0 : event.target.controller.view.labelElement.innerText.toLowerCase()) ===
  'items' ||
  (event === null || event === void 0 ? void 0 : event.target.controller.view.labelElement.innerText.toLowerCase()) ===
  'underlap' ||
  (event === null || event === void 0 ? void 0 : event.target.controller.view.labelElement.innerText.toLowerCase()) ===
  'transition')
  {
    generateList();
    generateKeyframes();
  }
};

const sync = event => {
  if (
  !document.startViewTransition ||
  event.target.controller.view.labelElement.innerText !== 'Theme')

  return update(event);
  document.startViewTransition(() => update(event));
};

ctrl.addBinding(config, 'items', {
  min: 2,
  max: 10,
  step: 1,
  label: 'items' });


const travel = ctrl.addFolder({ title: 'travel', expanded: true });
travel.addBinding(config, 'x', {
  min: -100,
  max: 100,
  step: 1,
  label: 'x' });

travel.addBinding(config, 'y', {
  min: -100,
  max: 100,
  step: 1,
  label: 'y' });

travel.addBinding(config, 'blur', {
  min: 0,
  max: 20,
  step: 1,
  label: 'blur' });


const timings = ctrl.addFolder({ title: 'Timing', expanded: false });

timings.addBinding(config, 'underlap', {
  min: 0,
  max: 10,
  step: 0.1,
  label: 'underlap' });

timings.addBinding(config, 'duration', {
  min: 2,
  max: 60,
  step: 1,
  label: 'duration' });

timings.addBinding(config, 'transition', {
  min: 0,
  max: 10,
  step: 0.1,
  label: 'transition' });

timings.addBinding(config, 'stagger', {
  min: 0,
  max: 1,
  step: 0.01,
  label: 'stagger' });


ctrl.addBinding(config, 'explode', {
  label: 'explode' });


ctrl.addBinding(config, 'theme', {
  label: 'Theme',
  options: {
    System: 'system',
    Light: 'light',
    Dark: 'dark' } });



ctrl.on('change', sync);
update();
generateList();
generateKeyframes();